import React from 'react';
import { Box, Container, Heading, useColorModeValue } from '@chakra-ui/react';
import Timeline from 'react-calendar-timeline';
import 'react-calendar-timeline/lib/Timeline.css';

const groups = [
  { id: 1, title: 'Event Group' },
];

const items = [
  { id: 1, group: 1, title: 'Induction + Team Building', start_time: new Date(2024, 5, 9), end_time: new Date(2024, 5, 9) },
  { id: 2, group: 1, title: 'Familiarize with Git, GitHub, Figma', start_time: new Date(2024, 5, 16), end_time: new Date(2024, 5, 16) },
  { id: 3, group: 1, title: 'Researching Projects and Domains', start_time: new Date(2024, 5, 23), end_time: new Date(2024, 5, 23) },
  { id: 4, group: 1, title: 'Group Formation and UX/UI Session', start_time: new Date(2024, 5, 30), end_time: new Date(2024, 5, 30) },
  { id: 5, group: 1, title: 'Product-Market Fit and Product Development', start_time: new Date(2024, 6, 7), end_time: new Date(2024, 6, 7) },
  { id: 6, group: 1, title: 'Meeting with Development Mentor', start_time: new Date(2024, 6, 14), end_time: new Date(2024, 6, 14) },
  { id: 7, group: 1, title: 'Mentor Session + Resume Building', start_time: new Date(2024, 6, 21), end_time: new Date(2024, 6, 21) },
  { id: 8, group: 1, title: 'Mentor Session + LinkedIn Building', start_time: new Date(2024, 6, 28), end_time: new Date(2024, 6, 28) },
  { id: 9, group: 1, title: 'Finalizing Project and Deployment', start_time: new Date(2024, 7, 4), end_time: new Date(2024, 7, 4) },
  { id: 10, group: 1, title: 'Project Showcasing', start_time: new Date(2024, 7, 11), end_time: new Date(2024, 7, 11) },
];

const CalendarTimeline = () => {
  const bg = useColorModeValue('white', 'gray.800');
  const textColor = useColorModeValue('gray.700', 'gray.300');

  return (
    <Container maxW="container.md" py={10}>
      <Heading as="h1" mb={8} color={textColor}>
        Calendar Timeline
      </Heading>
      <Box bg={bg} p={4} borderRadius="md" boxShadow="md">
        <Timeline
          groups={groups}
          items={items}
          defaultTimeStart={new Date(2024, 5, 1)}
          defaultTimeEnd={new Date(2024, 7, 15)}
          lineHeight={80} // Increased line height
          itemHeightRatio={1} // Increased item height ratio
        />
      </Box>
    </Container>
  );
};

export default CalendarTimeline;
